import question from "./Api";
import "./index.css"

let App = () =>{
    return(
        <>
        <div className="Accodion_style">
        {question.map((CurValue, Index)=>{
            return(
               <>
               <h2>{CurValue.Ques}</h2>
                <p>{CurValue.Answer}</p>
               </>
            )

        })}

        </div>
        

        </>
    )

}

export default App;
